import React from 'react';


class GameDetail extends React.Component {
    constructor(props) {
        super(props);

    }   

    componentDidMount() {
        return this.props.fetchGames()
    }

    render () {
        return (
        <div>
            {this.props.allGames.map(game => game.title)}
        </div>)
    }

}

export default GameDetail
